import React, { useEffect, useState, useCallback, useRef } from 'react';
import { debounce } from 'lodash';
import cx from 'classnames';
import { Button, Input } from 'antd';
import { CloseOutlined } from '@ant-design/icons';
import { CellMeasurer, CellMeasurerCache, List } from 'react-virtualized';
import { SearchResult } from '../types';
import formatMessage from '../locales';

const cache = new CellMeasurerCache({
  defaultHeight: 34,
  fixedWidth: true,
});

interface ReplaceProps {
  visible: boolean;
  searchResults: SearchResult[];
  currentResult: number;
  onSearch: (key: string) => void;
  onReplace: (key: string) => void;
  onReplaceAll: (key: string) => void;
  onNext: () => void;
  onClose: () => void;
  onFocus: (index: number) => void;
}

const formatText = (text: string, start: number, end: number) => `${text.substring(0, start)}<span class="highlight">${text.substring(start, end)}</span>${text.substring(end)}`;

const FindAndReplace = ({
  visible,
  searchResults,
  currentResult,
  onSearch,
  onReplace,
  onReplaceAll,
  onNext,
  onClose,
  onFocus,
}: ReplaceProps) => {
  const listRef = useRef<List>(null);
  const [findKey, setFindKey] = useState('');
  const [replaceKey, setReplaceKey] = useState('');
  const [composition, setComposition] = useState(false);

  const search = useCallback(debounce(onSearch, 500), []);

  useEffect(() => {
    if (!composition) {
      search(findKey);
    }
  }, [findKey, composition]);

  useEffect(() => {
    if (currentResult >= 0 && visible) {
      listRef.current?.scrollToRow(currentResult);
      setTimeout(() => listRef.current?.scrollToRow(currentResult), 0);
    }
  }, [currentResult, visible]);

  if (!visible) {
    return null;
  }

  return (
    <div className="replace-popup">
      <div className="popup-title">
        <b>{formatMessage('REPLACE_TITLE')}</b>
        <CloseOutlined onClick={onClose} />
      </div>
      <div>{formatMessage('REPLACE_FIND')}</div>
      <Input
        value={findKey}
        onChange={(e) => setFindKey(e.target.value)}
        onCompositionStart={() => setComposition(true)}
        onCompositionEnd={() => setComposition(false)}
      />
      <div className="replace-popup-btns">
        <div className="popup-tip">
          {findKey && formatMessage('REPLACE_FIND_RESULT', { values: { count: searchResults.length } })}
        </div>
        <Button type="primary" onClick={onNext}>
          {formatMessage('REPLACE_BUTTON_NEXT')}
        </Button>
      </div>
      <div style={{ marginBottom: 4, marginTop: 24 }}>{formatMessage('REPLACE_REPLACE')}</div>
      <Input value={replaceKey} onChange={(e) => setReplaceKey(e.target.value)} />
      <div className="replace-popup-btns">
        <div />
        <div>
          <Button style={{ marginRight: 12 }} onClick={() => onReplaceAll(replaceKey)}>
            {formatMessage('REPLACE_BUTTON_REPLACE_ALL')}
          </Button>
          <Button onClick={() => onReplace(replaceKey)}>
            {formatMessage('REPLACE_BUTTON_REPLACE')}
          </Button>
        </div>
      </div>
      {findKey && searchResults.length > 0 && (
        <div className="search-results">
          <div className="search-results-title">
            {formatMessage('REPLACE_SEARCH_RESULT', { values: { current: currentResult + 1, count: searchResults.length } })}
          </div>
          <div className="search-results-content">
            <List
              ref={listRef}
              style={{ outline: 'none' }}
              width={492}
              height={340}
              deferredMeasurementCache={cache}
              rowCount={searchResults.length}
              rowHeight={cache.rowHeight}
              rowRenderer={({ index, key, parent, style }) => (
                <CellMeasurer
                  cache={cache}
                  columnIndex={0}
                  key={key}
                  parent={parent}
                  rowIndex={index}
                >
                  <div
                    style={style}
                    className={cx('search-results-item', {
                      active: index === currentResult,
                      'search-results-item__bg': index % 2 !== 0,
                    })}
                    onClick={() => onFocus(index)}
                    // eslint-disable-next-line react/no-danger
                    dangerouslySetInnerHTML={{ __html: formatText(searchResults[index].text, searchResults[index].start, searchResults[index].end) }}
                  />
                </CellMeasurer>
              )}
            />
          </div>
        </div>
      )}
    </div>
  );
};

export default FindAndReplace;
